static real_T det(real_T x[9])
{
  real_T A[9];
  real_T smax;
  real_T y;
  int32_T c;
  int32_T i;
  int32_T i1;
  int32_T ijA;
  int32_T ix;
  int32_T iy;
  int32_T j;
  int32_T jy;
  int32_T k;
  int8_T ipiv[3];
  boolean_T isodd;
  memcpy(&A[0], &x[0], 9U * sizeof(real_T));
  for (i = 0; i < 3; i++) {
    ipiv[i] = (int8_T)(i + 1);
  }

  for (j = 0; j < 2; j++) {
    c = j << 2;
    iy = 4 - j;
    jy = 1;
    ix = c;
    smax = muDoubleScalarAbs(A[c]);
    for (k = 2; k < iy; k++) {
      ix++;
      y = muDoubleScalarAbs(A[ix]);
      if (y > smax) {
        jy = k;
        smax = y;
      }
    }

    if (A[(c + jy) - 1] != 0.0) {
      if (jy - 1 != 0) {
        ipiv[j] = (int8_T)(j + jy);
        ix = j;
        iy = (j + jy) - 1;
        for (k = 0; k < 3; k++) {
          smax = A[ix];
          A[ix] = A[iy];
          A[iy] = smax;
          ix += 3;
          iy += 3;
        }
      }

      i = c - j;
      for (iy = c + 2; iy <= i + 3; iy++) {
        A[iy - 1] /= A[c];
      }
    }

    iy = c;
    jy = c + 3;
    i = 1 - j;
    for (k = 0; k <= i; k++) {
      smax = A[jy];
      if (A[jy] != 0.0) {
        ix = c;
        i1 = iy - j;
        for (ijA = iy + 5; ijA <= i1 + 6; ijA++) {
          A[ijA - 1] += A[ix + 1] * -smax;
          ix++;
        }
      }

      jy += 3;
      iy += 3;
    }
  }

  y = A[0];
  isodd = false;
  for (k = 0; k < 2; k++) {
    y *= A[(k + 3 * (k + 1)) + 1];
    if (ipiv[k] > k + 1) {
      isodd = !isodd;
    }
  }

  if (isodd) {
    y = -y;
  }

  return y;
}

