static void visionDetectionGenerator_getClosestRegionIntersection(const
  emlrtStack *sp, real_T uvSeg[4], real_T uvRegion[8], real_T uvInt[2])
{
  emlrtStack st;
  real_T b_uvInt[8];
  real_T dInt[4];
  real_T b_dv[2];
  real_T b_uvRegion[2];
  real_T b_uvSeg[2];
  real_T c_uvRegion[2];
  real_T c_uvSeg[2];
  real_T ex;
  int32_T b_r;
  int32_T i;
  int32_T k;
  int32_T r;
  boolean_T exitg1;
  st.prev = sp;
  st.tls = sp->tls;
  for (k = 0; k < 4; k++) {
    if (k == 0) {
      r = 0;
    } else {
      r = k;
    }

    r = (int32_T)emlrtIntegerCheckR2012b((real_T)r + 1.0, &b_emlrtDCI,
      (emlrtConstCTX)sp);
    i = (int32_T)emlrtIntegerCheckR2012b(muDoubleScalarRem((real_T)k + 1.0, 4.0)
      + 1.0, &emlrtDCI, (emlrtConstCTX)sp);
    b_r = emlrtDynamicBoundsCheckR2012b(i, 1, 4, &f_emlrtBCI, (emlrtConstCTX)sp);
    for (i = 0; i < 2; i++) {
      b_uvSeg[i] = uvSeg[i << 1];
      c_uvSeg[i] = uvSeg[(i << 1) + 1];
      b_uvRegion[i] = uvRegion[(r + (i << 2)) - 1];
      c_uvRegion[i] = uvRegion[(b_r + (i << 2)) - 1];
    }

    st.site = &pd_emlrtRSI;
    ComputationalGeometry_intersectLines2D(&st, b_uvSeg, c_uvSeg, b_uvRegion,
      c_uvRegion, b_dv, &ex);
    for (i = 0; i < 2; i++) {
      b_uvInt[k + (i << 2)] = b_dv[i];
    }

    dInt[k] = ex;
  }

  for (k = 0; k < 4; k++) {
    dInt[k] = muDoubleScalarAbs(dInt[k]);
  }

  if (!muDoubleScalarIsNaN(dInt[0])) {
    b_r = 1;
  } else {
    b_r = 0;
    k = 2;
    exitg1 = false;
    while ((!exitg1) && (k < 5)) {
      if (!muDoubleScalarIsNaN(dInt[k - 1])) {
        b_r = k;
        exitg1 = true;
      } else {
        k++;
      }
    }
  }

  if (b_r != 0) {
    ex = dInt[b_r - 1];
    r = b_r;
    for (k = b_r + 1; k < 5; k++) {
      if (ex > dInt[k - 1]) {
        ex = dInt[k - 1];
        r = k;
      }
    }

    b_r = r - 1;
  }

  for (i = 0; i < 2; i++) {
    uvInt[i] = b_uvInt[b_r + (i << 2)];
  }
}

static void ComputationalGeometry_intersectLines2D(const emlrtStack *sp, real_T
  x1In[2], real_T x2In[2], real_T y1In[2], real_T y2In[2], real_T xi[2], real_T *
  s)
{
  emlrtStack st;
  real_T z_data[2100];
  real_T b_dv[2];
  real_T e_tmp_data[2];
  real_T n2[2];
  real_T v1[2];
  real_T v2[2];
  real_T d_tmp_data[1];
  real_T den_data[1];
  real_T d;
  real_T den;
  int32_T b_tmp_size[2];
  int32_T c_tmp_size[2];
  int32_T d_tmp_size[2];
  int32_T den_size[2];
  int32_T f_tmp_size[2];
  int32_T tmp_size[2];
  int32_T v1_size[2];
  int32_T z_size[2];
  int32_T e_tmp_size[1];
  int32_T b_i;
  int32_T b_trueCount;
  int32_T c_trueCount;
  int32_T i;
  int32_T trueCount;
  boolean_T iGd;
  st.prev = sp;
  st.tls = sp->tls;
  for (i = 0; i < 2; i++) {
    v1[i] = x2In[i] - x1In[i];
    v2[i] = y2In[i] - y1In[i];
  }

  n2[0] = -v2[1];
  n2[1] = v2[0];
  *s = rtNaN;
  for (b_i = 0; b_i < 2; b_i++) {
    xi[b_i] = rtNaN;
  }

  j_bsxfun(n2, v1, b_dv);
  den = b_sumColumnB(b_dv);
  iGd = (muDoubleScalarAbs(muDoubleScalarRound(den / 1.0E-6)) > 0.0);
  if (iGd) {
    k_bsxfun(y1In, x1In, b_dv);
    j_bsxfun(n2, b_dv, v2);
    trueCount = 0;
    tmp_size[0] = 1;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        trueCount++;
      }
    }

    tmp_size[1] = trueCount;
    b_trueCount = 0;
    b_tmp_size[0] = 1;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        b_trueCount++;
      }
    }

    b_tmp_size[1] = b_trueCount;
    c_trueCount = 0;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        c_trueCount++;
      }
    }

    b_sumColumnB(v2);
    c_tmp_size[0] = 1;
    c_tmp_size[1] = trueCount;
    den_size[0] = 1;
    den_size[1] = b_trueCount;
    st.site = &rd_emlrtRSI;
    assertCompatibleDims(&st, c_tmp_size, den_size);
    if (trueCount == b_trueCount) {
      d = b_sumColumnB(v2);
      z_size[1] = trueCount;
      for (i = 0; i < trueCount; i++) {
        z_data[0] = d / den;
      }
    } else {
      binary_expand_op_1(z_data, z_size, v2, tmp_size, den, b_tmp_size);
    }

    emlrtSubAssignSizeCheck1dR2017a(c_trueCount, z_size[1], &b_emlrtECI,
      (emlrtConstCTX)sp);
    den_data[0] = rtNaN;
    b_i = z_size[1];
    for (i = 0; i < b_i; i++) {
      den_data[0] = z_data[0];
    }

    *s = den_data[0];
    trueCount = 0;
    d_tmp_size[0] = 1;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        trueCount++;
      }
    }

    d_tmp_size[1] = trueCount;
    b_trueCount = 0;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        b_trueCount++;
      }
    }

    e_tmp_size[0] = b_trueCount;
    v1_size[0] = 2;
    v1_size[1] = b_trueCount;
    for (i = 0; i < b_trueCount; i++) {
      d_tmp_data[0] = den_data[0];
      for (b_i = 0; b_i < 2; b_i++) {
        n2[b_i] = v1[b_i];
      }
    }

    st.site = &qd_emlrtRSI;
    l_bsxfun(&st, d_tmp_data, e_tmp_size, n2, v1_size, v2, tmp_size);
    b_trueCount = 0;
    for (b_i = 0; b_i < 1; b_i++) {
      if (iGd) {
        b_trueCount++;
      }
    }

    if (trueCount == tmp_size[1]) {
      f_tmp_size[0] = 2;
      f_tmp_size[1] = trueCount;
      for (i = 0; i < trueCount; i++) {
        for (b_i = 0; b_i < 2; b_i++) {
          e_tmp_data[b_i] = x1In[b_i] + v2[b_i];
        }
      }
    } else {
      binary_expand_op(e_tmp_data, f_tmp_size, x1In, d_tmp_size, v2, tmp_size);
    }

    tmp_size[0] = 2;
    tmp_size[1] = b_trueCount;
    emlrtSubAssignSizeCheckR2012b(&tmp_size[0], 2, &f_tmp_size[0], 2,
      &c_emlrtECI, (void *)sp);
    for (i = 0; i < b_trueCount; i++) {
      for (b_i = 0; b_i < 2; b_i++) {
        xi[b_i] = e_tmp_data[b_i];
      }
    }
  }
}

