static void isSymmetricPositiveSemiDefinite(const emlrtStack *sp, real_T
  b_value[36])
{
  static const int32_T iv[2] = { 1, 52 };

  static const int32_T iv1[2] = { 1, 52 };

  static const int32_T iv2[2] = { 1, 16 };

  static char_T b_u[52] = { 's', 'h', 'a', 'r', 'e', 'd', '_', 't', 'r', 'a',
    'c', 'k', 'i', 'n', 'g', ':', 'K', 'a', 'l', 'm', 'a', 'n', 'F', 'i', 'l',
    't', 'e', 'r', ':', 'i', 'n', 'v', 'a', 'l', 'i', 'd', 'C', 'o', 'v', 'a',
    'r', 'i', 'a', 'n', 'c', 'e', 'V', 'a', 'l', 'u', 'e', 's' };

  static char_T d_u[16] = { 'M', 'e', 'a', 's', 'u', 'r', 'e', 'm', 'e', 'n',
    't', 'N', 'o', 'i', 's', 'e' };

  ptrdiff_t ihi_t;
  ptrdiff_t ilo_t;
  ptrdiff_t info_t;
  emlrtStack b_st;
  emlrtStack c_st;
  emlrtStack d_st;
  emlrtStack st;
  const mxArray *d_y;
  const mxArray *e_y;
  const mxArray *f_y;
  const mxArray *m;
  creal_T d[6];
  real_T A[36];
  real_T y[36];
  real_T scale[6];
  real_T wimag[6];
  real_T wreal[6];
  real_T abnrm;
  real_T absx;
  real_T rconde;
  real_T rcondv;
  real_T tol;
  real_T vright;
  int32_T exitg2;
  int32_T i;
  int32_T i1;
  int32_T idx;
  int32_T iy;
  char_T u[52];
  char_T c_u[16];
  boolean_T x[36];
  boolean_T b_y[6];
  boolean_T c_y;
  boolean_T exitg1;
  boolean_T notPositiveSemidefinite;
  st.prev = sp;
  st.tls = sp->tls;
  b_st.prev = &st;
  b_st.tls = st.tls;
  c_st.prev = &b_st;
  c_st.tls = b_st.tls;
  for (i1 = 0; i1 < 6; i1++) {
    wreal[i1] = muDoubleScalarAbs(b_value[i1 + 6 * i1]);
  }

  if (!muDoubleScalarIsNaN(wreal[0])) {
    idx = 1;
  } else {
    idx = 0;
    i1 = 2;
    exitg1 = false;
    while ((!exitg1) && (i1 < 7)) {
      if (!muDoubleScalarIsNaN(wreal[i1 - 1])) {
        idx = i1;
        exitg1 = true;
      } else {
        i1++;
      }
    }
  }

  if (idx == 0) {
    absx = wreal[0];
  } else {
    absx = wreal[idx - 1];
    for (i1 = idx + 1; i1 < 7; i1++) {
      if (absx < wreal[i1 - 1]) {
        absx = wreal[i1 - 1];
      }
    }
  }

  absx = muDoubleScalarAbs(absx);
  if (muDoubleScalarIsInf(absx) || muDoubleScalarIsNaN(absx)) {
    absx = rtNaN;
  } else if (absx < 4.4501477170144028E-308) {
    absx = 4.94065645841247E-324;
  } else {
    frexp(absx, &iy);
    absx = ldexp(1.0, iy - 53);
  }

  tol = 100.0 * absx;
  for (idx = 0; idx < 6; idx++) {
    for (iy = 0; iy < 6; iy++) {
      A[iy + 6 * idx] = b_value[iy + 6 * idx] - b_value[idx + 6 * iy];
    }
  }

  for (i1 = 0; i1 < 36; i1++) {
    y[i1] = muDoubleScalarAbs(A[i1]);
  }

  absx = tol;
  st.site = &th_emlrtRSI;
  d_sqrt(&st, &absx);
  for (idx = 0; idx < 36; idx++) {
    x[idx] = (y[idx] < absx);
  }

  for (idx = 0; idx < 6; idx++) {
    b_y[idx] = true;
  }

  idx = 0;
  iy = -1;
  for (i = 0; i < 6; i++) {
    i1 = idx + 1;
    idx += 6;
    iy++;
    exitg1 = false;
    while ((!exitg1) && (i1 <= idx)) {
      if (!x[i1 - 1]) {
        b_y[iy] = false;
        exitg1 = true;
      } else {
        i1++;
      }
    }
  }

  c_y = true;
  i1 = 0;
  exitg1 = false;
  while ((!exitg1) && (i1 < 6)) {
    if (!b_y[i1]) {
      c_y = false;
      exitg1 = true;
    } else {
      i1++;
    }
  }

  st.site = &uh_emlrtRSI;
  for (idx = 0; idx < 6; idx++) {
    for (iy = 0; iy < 6; iy++) {
      A[iy + 6 * idx] = (b_value[iy + 6 * idx] + b_value[idx + 6 * iy]) / 2.0;
    }
  }

  notPositiveSemidefinite = true;
  for (i1 = 0; i1 < 36; i1++) {
    absx = A[i1];
    if (notPositiveSemidefinite && ((!muDoubleScalarIsInf(absx)) &&
         (!muDoubleScalarIsNaN(absx)))) {
      notPositiveSemidefinite = true;
    } else {
      notPositiveSemidefinite = false;
    }
  }

  if (!notPositiveSemidefinite) {
    for (i = 0; i < 6; i++) {
      d[i].re = rtNaN;
      d[i].im = 0.0;
    }
  } else {
    notPositiveSemidefinite = true;
    idx = 0;
    exitg1 = false;
    while ((!exitg1) && (idx < 6)) {
      i = 0;
      do {
        exitg2 = 0;
        if (i <= idx) {
          if (!(A[i + 6 * idx] == A[idx + 6 * i])) {
            notPositiveSemidefinite = false;
            exitg2 = 1;
          } else {
            i++;
          }
        } else {
          idx++;
          exitg2 = 2;
        }
      } while (exitg2 == 0);

      if (exitg2 == 1) {
        exitg1 = true;
      }
    }

    if (notPositiveSemidefinite) {
      b_st.site = &vh_emlrtRSI;
      c_st.site = &yh_emlrtRSI;
      d_st.site = &bi_emlrtRSI;
      ilo_t = (ptrdiff_t)6;
      info_t = LAPACKE_dsyev(102, 'N', 'L', ilo_t, &A[0], ilo_t, &scale[0]);
      if ((int32_T)info_t < 0) {
        for (i = 0; i < 6; i++) {
          scale[i] = rtNaN;
        }
      }

      for (i = 0; i < 6; i++) {
        d[i].re = scale[i];
        d[i].im = 0.0;
      }

      if ((int32_T)info_t != 0) {
        c_st.site = &ai_emlrtRSI;
        c_warning(&c_st);
      }
    } else {
      notPositiveSemidefinite = true;
      idx = 0;
      exitg1 = false;
      while ((!exitg1) && (idx < 6)) {
        i = 0;
        do {
          exitg2 = 0;
          if (i <= idx) {
            if (!(A[i + 6 * idx] == -A[idx + 6 * i])) {
              notPositiveSemidefinite = false;
              exitg2 = 1;
            } else {
              i++;
            }
          } else {
            idx++;
            exitg2 = 2;
          }
        } while (exitg2 == 0);

        if (exitg2 == 1) {
          exitg1 = true;
        }
      }

      if (notPositiveSemidefinite) {
        b_st.site = &wh_emlrtRSI;
        eigSkewHermitianStandard(&b_st, A, d);
      } else {
        b_st.site = &xh_emlrtRSI;
        c_st.site = &ej_emlrtRSI;
        info_t = LAPACKE_dgeevx(102, 'B', 'N', 'N', 'N', (ptrdiff_t)6, &A[0],
          (ptrdiff_t)6, &wreal[0], &wimag[0], &absx, (ptrdiff_t)1, &vright,
          (ptrdiff_t)1, &ilo_t, &ihi_t, &scale[0], &abnrm, &rconde, &rcondv);
        if ((int32_T)info_t < 0) {
          for (i = 0; i < 6; i++) {
            d[i].re = rtNaN;
            d[i].im = 0.0;
          }
        } else {
          for (i = 0; i < 6; i++) {
            d[i].re = wreal[i];
            d[i].im = wimag[i];
          }
        }

        if ((int32_T)info_t != 0) {
          c_st.site = &fj_emlrtRSI;
          c_warning(&c_st);
        }
      }
    }
  }

  for (idx = 0; idx < 6; idx++) {
    b_y[idx] = (d[idx].re < -tol);
  }

  notPositiveSemidefinite = false;
  i1 = 0;
  exitg1 = false;
  while ((!exitg1) && (i1 < 6)) {
    if (!b_y[i1]) {
      i1++;
    } else {
      notPositiveSemidefinite = true;
      exitg1 = true;
    }
  }

  if (notPositiveSemidefinite || (!c_y)) {
    for (idx = 0; idx < 52; idx++) {
      u[idx] = b_u[idx];
    }

    d_y = NULL;
    m = emlrtCreateCharArray(2, &iv[0]);
    emlrtInitCharArrayR2013a((emlrtConstCTX)sp, 52, m, &u[0]);
    emlrtAssign(&d_y, m);
    for (idx = 0; idx < 52; idx++) {
      u[idx] = b_u[idx];
    }

    e_y = NULL;
    m = emlrtCreateCharArray(2, &iv1[0]);
    emlrtInitCharArrayR2013a((emlrtConstCTX)sp, 52, m, &u[0]);
    emlrtAssign(&e_y, m);
    for (idx = 0; idx < 16; idx++) {
      c_u[idx] = d_u[idx];
    }

    f_y = NULL;
    m = emlrtCreateCharArray(2, &iv2[0]);
    emlrtInitCharArrayR2013a((emlrtConstCTX)sp, 16, m, &c_u[0]);
    emlrtAssign(&f_y, m);
    st.site = &is_emlrtRSI;
    error(&st, d_y, getString(&st, message(&st, e_y, f_y, &mb_emlrtMCI),
           &mb_emlrtMCI), &mb_emlrtMCI);
  }
}

static real_T xnrm2(int32_T n, real_T x[36], int32_T ix0)
{
  real_T absxk;
  real_T scale;
  real_T t;
  real_T y;
  int32_T k;
  int32_T kend;
  y = 0.0;
  if (n < 1) {
  } else if (n == 1) {
    y = muDoubleScalarAbs(x[ix0 - 1]);
  } else {
    scale = 3.3121686421112381E-170;
    kend = ix0 + n;
    for (k = ix0; k < kend; k++) {
      absxk = muDoubleScalarAbs(x[k - 1]);
      if (absxk > scale) {
        t = scale / absxk;
        y = y * t * t + 1.0;
        scale = absxk;
      } else {
        t = absxk / scale;
        y += t * t;
      }
    }

    y = scale * muDoubleScalarSqrt(y);
  }

  return y;
}

