static void ensureSymmetricPositiveSemidefinite(const emlrtStack *sp, real_T
  Pin[16], real_T Pout[16])
{
  emlrtStack st;
  creal_T D[16];
  creal_T Q[16];
  creal_T b_Q[16];
  creal_T d[4];
  creal_T b_d;
  real_T b_Pin[16];
  real_T x;
  real_T y;
  int32_T i;
  int32_T i1;
  int32_T k;
  boolean_T p;
  st.prev = sp;
  st.tls = sp->tls;
  for (k = 0; k < 4; k++) {
    for (i = 0; i < 4; i++) {
      b_Pin[i + (k << 2)] = (Pin[i + (k << 2)] + Pin[k + (i << 2)]) / 2.0;
    }
  }

  st.site = &pp_emlrtRSI;
  b_eig(&st, b_Pin, Q, D);
  for (k = 0; k < 4; k++) {
    b_d.re = D[k + (k << 2)].re;
    b_d.im = D[k + (k << 2)].im;
    if (muDoubleScalarIsNaN(b_d.re) || muDoubleScalarIsNaN(b_d.im)) {
      p = true;
    } else {
      if ((muDoubleScalarAbs(b_d.re) > 8.9884656743115785E+307) ||
          (muDoubleScalarAbs(b_d.im) > 8.9884656743115785E+307)) {
        x = muDoubleScalarHypot(b_d.re / 2.0, b_d.im / 2.0);
        y = 0.0;
      } else {
        x = muDoubleScalarHypot(b_d.re, b_d.im);
        y = 0.0;
      }

      if (x == 0.0) {
        x = muDoubleScalarAtan2(b_d.im, b_d.re);
        if (x == 0.0) {
          if (b_d.re != 0.0) {
            x = 0.0;
            y = b_d.re;
          } else {
            x = b_d.im;
            y = 0.0;
          }

          if (x == y) {
            x = 0.0;
            y = 0.0;
          }
        }
      }

      p = (x < y);
    }

    if (p) {
      x = 0.0;
      y = 0.0;
    } else {
      x = b_d.re;
      y = b_d.im;
    }

    b_d.re = x;
    b_d.im = y;
    d[k] = b_d;
  }

  for (k = 0; k < 16; k++) {
    D[k].re = 0.0;
    D[k].im = 0.0;
  }

  for (k = 0; k < 4; k++) {
    D[k + (k << 2)].re = d[k].re;
    D[k + (k << 2)].im = d[k].im;
  }

  for (k = 0; k < 4; k++) {
    for (i = 0; i < 4; i++) {
      b_Q[k + (i << 2)].re = 0.0;
      b_Q[k + (i << 2)].im = 0.0;
      for (i1 = 0; i1 < 4; i1++) {
        b_Q[k + (i << 2)].re += Q[k + (i1 << 2)].re * D[i1 + (i << 2)].re - Q[k
          + (i1 << 2)].im * D[i1 + (i << 2)].im;
        b_Q[k + (i << 2)].im += Q[k + (i1 << 2)].re * D[i1 + (i << 2)].im + Q[k
          + (i1 << 2)].im * D[i1 + (i << 2)].re;
      }
    }

    for (i = 0; i < 4; i++) {
      x = 0.0;
      for (i1 = 0; i1 < 4; i1++) {
        x += b_Q[k + (i1 << 2)].re * Q[i + (i1 << 2)].re - b_Q[k + (i1 << 2)].im
          * -Q[i + (i1 << 2)].im;
      }

      Pout[k + (i << 2)] = x;
    }
  }

  for (k = 0; k < 4; k++) {
    for (i = 0; i < 4; i++) {
      b_Pin[i + (k << 2)] = (Pout[i + (k << 2)] + Pout[k + (i << 2)]) / 2.0;
    }
  }

  memcpy(&Pout[0], &b_Pin[0], sizeof(real_T) << 4);
}

